import { Link } from "react-router-dom";

export default function NavigationPC(props) {

    const navItemArray = props.navList.map((item, index) => {
        return (
            <li key={index}>
                <Link to={item.link} aria-label={item.ariaLabel}>
                    {item.name}
                </Link>
            </li>
        )
    })    

    return (
        <div className="nav-container">
            <div className="brand-container">
                <ul>
                    <li className="brand">
                        <a href="home_page.html" aria-label="Home">
                            <img src="/img/iron.png" alt="" 
                            style={{
                                height: '24px', 
                                marginRight: '5px',
                            }} />
                            Furever Home
                        </a>
                    </li>
                    <li>
                        <ul id='nav-pages'>
                            {navItemArray}
                        </ul>
                    </li>
                </ul>
            </div>
            <div className="login-container">
                <div id='login-block'>
                    <ul className="login">
                        <li><a href="#" aria-label="Sign Up">Sign Up</a></li>
                        <li><a href="#" aria-label="Login">Login</a></li>
                    </ul>
                </div>
            </div>
        </div>
    );
}
